import React, { useState, useEffect } from 'react';
import { Row, Col, Container } from 'reactstrap';
import Commonsection from '../shared/commonsection';
import tourData from '../assets/data/tours';
import TourCard from '../shared/tourcard';
import SearchBar from '../shared/SearchBar';
import Newsletter from '../shared/newslatter';
import tour from'../tour.css';


const Tour = () => {
  const [pageCount, setPageCount] = useState(0)
  const [page, setPage] = useState(0)
  useEffect(() => {
    const page = Math.ceil(5 / 4)
    setPageCount(page)
  }, [page])



  return (
    <>
      <Commonsection title={'All tours'} />
      <section>
        <Container>
          <Row>
            <SearchBar />
          </Row>
        </Container>
      </section>
      <section className='pt-0'>
        <Container>
          <Row>
            {
              tourData?.map(tour => (<Col lg='3' className='mb-4' key={tour.id}>
                <TourCard tour={tour} /></Col>))
            }
            <Col lg='12'>
              <div className="pagination d-flex align-items-center justify-content-center mt-4 gap-3">
                {[...Array(pageCount).keys()].map(number => (
                  <span id='pag' key={number} onClick={() => setPage(number)}
                    className={page===number?'active__page':''}
                  >
                    {number + 1}
                  </span>
                ))}
              </div>
            </Col>
          </Row>
        </Container>
      </section>
    </>
  );
};

export default Tour;
